        <footer className="footer">
            <div className="info_contact">
                <p>© 2021 - All rights reserved</p>
            </div>
            <div className="mention_legale">
                <p>© 2021 - All rights reserved</p>
                <img src="https://www.alsacreations.com/xmedia/doc/fullpage/fullpage.png" alt="fullpage" />
            </div>
        </footer>
    );
}

export default Footer;
